import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import axios from 'axios';

export default class BugList extends Component {
    constructor(props) {
        super(props);

        this.state = {
            bugs: []
        }

    }
    render() {
        return (
            <div>
                <h1> Bugs list tracker</h1>
            </div>
        )
    }
}
